window.bookSummaryJSON = "<p>My closest friend has lost his mind. He killed my father, took over my kingdom, and despite the blood that now stains his hands, claims that we’re fated to be together.</p> <p>My salvation comes from the most unlikely of sources.</p> <p>To reclaim my throne, I’ll have to rely on the one man I’ve hated my entire life for survival.</p> <p>Solomon Winett is the noble descendant of barbarian warriors and the bane of my existence. He’s obnoxious, stubborn, and the only one who rescued me from a fate worse than death.</p> <p>I just need to remember one thing: once the line between hatred and passion has been crossed, there's no going back.</p>"; 
